def _make_proxy(value):
    ns = local.Local()
    ns.value = value

    class Proxy:
        def __getattr__(self, name):
            return getattr(ns.value, name)

        def __setattr__(self, name, value):
            setattr(ns.value, name, value)

        def __repr__(self):
            return repr(ns.value)

    p = Proxy()
    return ns, p
